import Vue from 'vue'
import VueRouter from 'vue-router'
import Welcome from '@/components/Welcome.vue'

Vue.use(VueRouter)

const routes = [
    {
        path: '/',
        name: 'welcome',
        component: Welcome
    }
]

export default new Router({
    routes: [
        {
            path: '/',
            name: 'welcome',
            component: Welcome
        }
    ]
})
